import { useState } from 'react'
const [ counter, setCounter ] = useState(0)

const IncreaseCount = (props) => {

  return (
    setCounter(props.counter + 1)
  )
}

const SetZero = props => {
  return (
    props.setCounter(0)
  )
}

const Button = (props) => {
  return (
    <button onClick={props.function}>{props.name}</button>
  )
}

const App = () => {

  return (
    <div>
      <Button function={IncreaseCount} name={"Click"}/>
      <Button function={SetZero} name={"Reset"}/>
    </div>
  )
}

export default App
